import React from 'react';
import './Footer.css'

const Footer = () => {
    return (
        <>
            <footer className="footer text-center5">
                <div className="container">
                    <p>&copy; 2024 Sangamesh Myageri. All rights reserved.</p>
                </div>
            </footer>
        </>
    );
};

export default Footer;
